import React from 'react';
import bank1 from '../assets/BOB.png';
import bank2 from '../assets/boi.png';
import bank3 from '../assets/cb.png';

const Services = () => {
  return (
    <section className="services">
      <div className="service-card">
        <img src={bank1} alt="Bank 1" />
        <h3>Online Banking</h3>
        <p>Experience hassle-free online banking with top-notch security.</p>
      </div>
      <div className="service-card">
        <img src={bank2} alt="Bank 2" />
        <h3>Loan Services</h3>
        <p>Get instant approvals and low-interest rates on personal and home loans.</p>
      </div>
      <div className="service-card">
        <img src={bank3} alt="Bank 3" />
        <h3>Credit Cards</h3>
        <p>Wide range of credit cards with attractive rewards and cashback.</p>
      </div>
    </section>
  );
};

export default Services;
